$(document).ready(function(){

   var background = "url('data:image/jpeg;base64,')";
   var image = "data:image/jpeg;base64,";
   var logo = "data:image/jpeg;base64,";
   
   document.getElementById('divBackground').style.backgroundImage = background;
   document.getElementById('image').src = image;
   document.getElementById('logo').src = logo;

});

// select image for background
function backgroundImage() {
	var filesSelected = document.getElementById("backgroundImageInput").files;
    console.log(filesSelected);
    if (filesSelected.length > 0)
    {
        var fileToLoad = filesSelected[0];

        var fileReader = new FileReader();

        fileReader.onload = function(fileLoadedEvent) 
        {
            document.getElementById('divBackground').style.backgroundImage = "url("+fileLoadedEvent.target.result+")";
                  
        };
 
        fileReader.readAsDataURL(fileToLoad);
    }
}


// select image for image
function selectImage() {

	var filesSelected = document.getElementById("imageInput").files;
    if (filesSelected.length > 0)
    {
        var fileToLoad = filesSelected[0];

        var fileReader = new FileReader();

        fileReader.onload = function(fileLoadedEvent) 
        {
            document.getElementById('image').src = fileLoadedEvent.target.result;
        };

        fileReader.readAsDataURL(fileToLoad);
    }
}

