function inputTitle(){
	var txt = $('#comment').val();
	$('#divTitle').text(txt);
}



function download(){
   
   var divBackground = document.getElementById('divBackground');
   var divTitle = document.getElementById('divTitle');
   var image = document.getElementById('image');
   var logo = document.getElementById('logo');

   divBackground.style.width = "1159px";
   divBackground.style.height = "655px";
   divTitle.style.fontSize="56px";
   divTitle.style.paddingRight = "40px";
   image.style.width = "575";
   image.style.height = "476px";
   logo.style.height = "100px";
   logo.style.width = "100px";
   logo.style.marginRight = "20px";

   $('#divBackground').clone().appendTo("#all");
   var element = $("#all");
   html2canvas(element, {
      onrendered: function (canvas) {
            var imgageData = canvas.toDataURL("image/png");
            var newData = imgageData.replace(/^data:image\/png/, "data:application/octet-stream");

            var link = document.getElementById('downloadLink');
            link.download = "myThumbnail.png";
            link.href = newData;
            link.click();      
          }
      });
    
    setTimeout(function(){window.location.reload();},2000);
}

function ChangeTitleColor(btn) {
	var clr = btn.style.backgroundColor;
	document.getElementById('divTitle').style.color = clr;
}

